Structs in Sway are a named grouping of types. You may also be familiar with structs via another name: product types . Sway does not make any significantly unique usages of structs; they are similar to most other languages which have structs. If you're coming from an object-oriented background, a struct is like the data attributes of an object. Firstly, we declare a struct named Foo with two fields. The first field is named bar and it accepts values of type u64, the second field is named baz and it accepts bool values. library data_structures; // Declare a struct type
pub struct Foo { bar: u64, baz: bool,
} // Struct types for destructuring
pub struct Point { x: u64, y: u64,
} pub struct Line { p1: Point, p2: Point,
} pub struct TupleInStruct { nested_tuple: (u64, (u32, (bool, str[2]))), } In order to instantiate the struct we use struct instantiation syntax , which is very similar to the declaration syntax except with expressions in place of types. There are three ways to instantiate the struct. Hardcoding values for the fields Passing in variables with names different than the struct fields Using a shorthand notation via variables that are the same as the field names library utils; dep data_structures;
use data_structures::{Foo, Line, Point, TupleInStruct}; fn hardcoded_instantiation() -> Foo { // Instantiate `foo` as `Foo` let mut foo = Foo { bar: 42, baz: false, }; // Access and write to "baz" foo.baz = true; // Return the struct foo
} fn variable_instantiation() -> Foo { // Declare variables with the same names as the fields in `Foo` let number = 42; let truthness = false; // Instantiate `foo` as `Foo` let mut foo = Foo { bar: number, baz: truthness, }; // Access and write to "baz" foo.baz = true; // Return the struct foo
} fn shorthand_instantiation() -> Foo { // Declare variables with the same names as the fields in `Foo` let bar = 42; let baz = false; // Instantiate `foo` as `Foo` let mut foo = Foo { bar, baz, }; // Access and write to "baz" foo.baz = true; // Return the struct foo
} fn struct_destructuring() { let point1 = Point { x: 0, y: 0, }; // Destructure the values from the struct into variables let Point { x, y } = point1; let point2 = Point { x: 1, y: 1, }; // If you do not care about specific struct fields then use ".." at the end of your variable list let Point { x, .. } = point2; let line = Line { p1: point1, p2: point2, }; // Destructure the values from the nested structs into variables let Line { p1: Point { x: x0, y: y0 }, p2: Point { x: x1, y: y1 } } = line; // You may also destructure tuples nested in structs and structs nested in tuples let tuple_in_struct = TupleInStruct { nested_tuple: (42u64, (42u32, (true, "ok"))), }; let TupleInStruct { nested_tuple: (a, (b, (c, d))) } = tuple_in_struct; let struct_in_tuple = (Point { x: 2, y: 4, }, Point { x: 3, y: 6, }); let(Point { x: x0, y: y0, }, Point { x: x1, y: y1, }) = struct_in_tuple;
} Note You can mix and match all 3 ways to instantiate the struct at the same time. Moreover, the order of the fields does not matter when instantiating however we encourage declaring the fields in alphabetical order and instantiating them in the same alphabetical order Furthermore, multiple variables can be extracted from a struct using the destructuring syntax.

